import React, { Component } from "react";
import Chart from "react-apexcharts";

class Donut extends Component {
  state = {};
  values = this.props;
  render() {
    return (
      <div className="donut">
        <Chart
          options={values.options}
          series={values.series}
          type="donut"
          width="380"
        />
      </div>
    );
  }
}

export default Donut;
